    }

    return (
        <div className="Board">
         <div className="Board-row">{renderSquare()}{(renderSquare)}{(renderSquare)}</div>    
         <div className="Board-row">{(renderSquare)}{(renderSquare)}{(renderSquare)}</div> 
         <div className="Board-row">{(renderSquare)}{(renderSquare)}{(renderSquare)}</div> 
        </div>
    )
}

export default Board
